import { BrowserRouter, Route, Routes } from 'react-router-dom';
import NavbarFooter from './Pages/Navbar_Footer';
import Index from './Pages/Index';
import './App.css';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <Routes>
            <Route element={<NavbarFooter />}>
              <Route path="/" element={<Index />} />
              <Route path="/jobs" element={<Index />} />
              <Route path="/companies" element={<Index />} />
              <Route path="/our-projects" element={<Index />} />
              <Route path="/servies" element={<Index />} />
            </Route>
          </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
